'''''Wisterian'' (20 December 1968)''' is an issue of a magazine published by [[Wikipedia:La Salle College High School|La Salle College High School]]. The issue (p. 3) reproduces a letter from [[J.R.R. Tolkien]] to Billy Callahan  (see [[Letter to Billy Callahan]]). Also includes a slightly inaccurate transcription of the letter.<ref>{{webcite|author=|articleurl=http://www.tolkienbooks.net/php/details.php?reference=55300|articlename=Wisterian. 1968|dated=|website=TB|accessed=5 July 2012}}</ref><ref name=CG>{{CG|C}}, p. 733</ref>

